def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i, ratio in enumerate(ratios):
        if ratio < 0.2:
            priorities[i] = 1 / (1 + np.exp(-12 * (ratio - 0.2)))
        elif ratio >= 0.2 and ratio < 0.4:
            priorities[i] = 1 / (1 + np.exp(-8 * (ratio - 0.3)))
        elif ratio >= 0.4 and ratio < 0.6:
            priorities[i] = 1 / (1 + np.exp(-5 * (ratio - 0.5)))
        elif ratio >= 0.6 and ratio < 0.8:
            priorities[i] = 1 / (1 + np.exp(-3 * (ratio - 0.7)))
        elif ratio >= 0.8 and ratio < 0.9:
            priorities[i] = 1 / (1 + np.exp(-10 * (ratio - 0.85)))
        else:
            priorities[i] = 1 / (1 + np.exp(-15 * (ratio - 1.0)))

    for j in range(len(priorities)):
        if priorities[j] < 0.5:
            priorities[j] += 0.1
        elif priorities[j] >= 0.5 and priorities[j] < 0.8:
            priorities[j] -= 0.05
        else:
            priorities[j] += 0.15

    return priorities
